            <SmartCallToAction h1SmartToActionTitle="Contact Me" smartCallToActionParagraph="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua." buttonText="Contact Me"/>
            <div className="lower-gradient-2"></div>
        </div>
    )
}

export default ThirdPart
